ThreadRng ThreadRng no longer implements Copy. This was necessary to fix a possible use-after-free in its thread-local destructor. Any code relying on ThreadRng being copied must be updated to use a mutable reference instead. For example, let rng = thread_rng();
let a: u32 = Standard.sample(rng);
let b: u32 = Standard.sample(rng); can be replaced with the following code: let mut rng = thread_rng();
let a: u32 = Standard.sample(&mut rng);
let b: u32 = Standard.sample(&mut rng); gen_range Rng::gen_range now takes a Range instead of two numbers. Thus, replace gen_range(a, b) with gen_range(a..b). We suggest using the following regular expression to search-replace in all files: replace gen_range\(([^,]*),\s*([^)]*)\) with gen_range(\1..\2) or with gen_range($1..$2) (if your tool does not support backreferences) Most IDEs support search-replace-across-files or similar; alternatively an external tool such as Regexxer may be used. This change has a couple of other implications: inclusive ranges are now supported, e.g. gen_range(1..=6) or gen_range('A'..='Z') it may be necessary to explicitly dereference some parameters SIMD types are no longer supported (Uniform types may still be used directly) fill The AsByteSliceMut trait was replaced with the Fill trait. This should only affect code implementing AsByteSliceMut on user-defined types, since the Rng::fill and Rng::try_fill retain support for previously-supported types. Fill supports some additional slice types which could not be supported with AsByteSliceMut: [bool], [char], [f32], [f64]. adapter The entire [rand::rngs::adapter] module is now restricted to the std feature. While this is technically a breaking change, it should only affect no_std code using ReseedingRng , which is unlikely to exist in the wild.

