很明显，另一个 RNG 也可以作为种子。 Rand 为此提供了一个很方便的方法： use rand::prelude::*;
use rand_pcg::Pcg64; let rng = Pcg64::from_rng(thread_rng()); 但是，如果说你想保存秘钥，然后之后再使用秘钥，那么，你需要更显式地指明： use rand::prelude::*;
use rand_chacha::ChaCha8Rng; let mut seed: <ChaCha8Rng as SeedableRng>::Seed = Default::default();
thread_rng().fill(&mut seed);
let rng = ChaCha8Rng::from_seed(seed); 警告 ： 有些简单的 PRNGs，尤其是 XorShiftRng ， 给它们设置同类 PRNG 的种子时，效果并不好 （比如这种情况下， Xorshift 会生成一份复制品）。 对于加密级的 PRNGs ，设置同类 PRNG 没什么问题； 但是对应非加密级的 PRNGs ，建议从不同的 PRNG 生成种子。 对于确定性的主生成器 (deterministic master generator)， 使用 ChaCha8Rng 是个不错的选中。 在加密场景，则建议 ChaCha12Rng 或更高的版本。

